import React from "react";
import InsertList from "../component/list"
import Grid from '@mui/material/Grid';
import Box from "@mui/material/Box";
function Dashboard(props) {
  return (
    <Box sx={{ flexGrow: 1 }}> 
      <Grid container spacing={2}>
        <Grid item xs={0}   >
                <h1>sdas</h1>
          <InsertList/>
        </Grid>
        <Grid item xs={8}>
                <h1>sdas</h1>
 
        </Grid>
      </Grid>
    </Box>
  );
}

export default Dashboard;
